import React from 'react';
import AppBar from '@mui/material/AppBar';
import { Tab, Tabs, Toolbar, Typography } from '@mui/material';
import './navBar.css';

function NavBar(){
    return(
        <React.Fragment>
            <AppBar >
                <Toolbar className='custom-tool-bar'>
                    <img src='/Images/Reynolds_pens_logo.png' className='reynold-logo' alt='logo'/>
                    <Tabs>
                        <Tab className='app-bar-tab' label='Home' sx={{color:'black'}}/>
                        <Tab className='app-bar-tab' label='Products'/>
                        <Tab className='app-bar-tab' label='About'/>
                        <Tab className='app-bar-tab' label='Contact Us'/>
                    </Tabs>
                </Toolbar>
            </AppBar>
        </React.Fragment>
    );
}

export default NavBar;
